</div>
<div class="block-right">
<h2>Lampy wewnętrzne:</h2>
<p class="images"> <a href="/" rel="lightbox-gal"><img alt="ABC" src="/ImgGalery/Img1/Bannery/ABC.JPG" /></a> <a href="/" rel="lightbox-gal"><img alt="svítidla Altera" src="/ImgGalery/Img1/Bannery/ALTERA.JPG" /></a> <a href="/" rel="lightbox-gal"><img alt="svítidla Arcada" src="/ImgGalery/Img1/Bannery/ARCADA.JPG" /></a></p>
